import logo from './logo.svg';
import './App.css';
import data from './data';

function App() {
  return (
    <div className="App">
      <header>
        <a href="/">My Store</a>
      </header>
      <main>
        <h1>Featured Products</h1>
        {data.products.map((product) => (
          <div key={product.slug}>
            <img src={product.image} alt={product.name} />
            <p>{product.name}</p>
            <p>{product.price}</p>
          </div>
        ))}
      </main>
    </div>
  );
}

export default App;
